import styled from 'styled-components'
export const SearchIcon = styled.i`
  font-size: 18px;
  color: #666;
  cursor: pointer;
  transform: translate(10px, 0px);
`
export const FormContainer = styled.form`
  input {
    margin-left: 30px;
    height: 30px;
    width: 250px;
    border: 0.2px solid #666;
    border-radius: 20px;
    box-shadow: 1px 1px 1px;
    padding-left: 10px;
  }

  input:focus {
    outline: none;
  }
`
